import React from 'react';

const ClienteList = ({ clientes }) => (
	<div>
		<h2>Lista de Clientes</h2>
		<ul>
			{clientes.map((cliente, idx) => (
				<li key={idx}>{cliente.nombre} - {cliente.correo} - {cliente.telefono}</li>
			))}
		</ul>
	</div>
);

export default ClienteList;
